    return (
        <div>
            <div className={styles.particlesContainer}>
                <Particles />
                <div className={styles.particlesTextContainer}>
                    <h1>I Am
                     <span className={styles.selfWritingText}>
                            <Typewriter className={styles.typeWriter}
                                options={{
                                    strings: ['Web Developer', 'Graphic Designer', 'Coder'],
                                    autoStart: true,
                                    loop: true,
                                }}
                            />
                        </span>
                    </h1>
                    <div className={styles.particlesTextContainerP}>
                        <p>
                            Lorem ipsum dolor sit amet, consectetur adipiscing elit.
                            Pharetra tincidunt phasellus sed imperdiet diam in commodo, viverra auctor.
                            Et dictumst tortor, tincidunt turpis amet, at ut a faucibus.
                    </p>
                    </div>

                </div>
            </div>
            <section className={styles.projectsSection}></section>
        </div>


    )
}

export default main
